import React, {useState, useEffect} from 'react';
import { BrowserRouter, Route } from 'react-router-dom';
import About from './pages/about.jsx';
import Posts from './pages/posts.jsx';

import './style/style.css'


function App() {


  return (
  <BrowserRouter>
  <Route path='/about'>
    <About></About>
  </Route>

  <Route path='/posts'>
    <Posts></Posts>
  </Route>

  </BrowserRouter>
  );
}

export default App;
